import React, { useState, useEffect, useContext, Fragment, useRef } from 'react';
import { Button, Grid, Input, Icon, Form, List, Label,
   Modal, Header, Message, Popup, Select, Radio,
   Tab, TextArea, Loader, Segment } from 'semantic-ui-react';


const Welcome = () => {

  return (
    <header className="App-header">
      <Segment style={{margin: 10}}>
      <Message color="blue" style={{margin: 10}}>
        <Message.Header style={{marginBottom: 20}}>
          Covid-19 Test Verification App
        </Message.Header>
        <div style={{marginBottom: 10}}>
          Please Click on the Scan tab to begin
        </div>
        <div>
          Simply Scan the QR code on your test and follow the instructions
        </div>
      </Message>
      </Segment>
    </header>
  )

}

export default Welcome;
